class Main extends React.Component {
  render() {
    return ( 
      <main className='main'>

        <section className='intro'>
          <div className='intro__wrap'>
            <div className='intro__logo'>
              <img className='logo-pic' src={introLogo} alt='logo'/>
            </div>
            <div className='intro__title'>
              Помощь <br/>
              в подготовке <br/>
              пакета <br/>
              документов <br/>
              для таможенного <br/>
              оформления
            </div>
            <div className='intro__pic'>
              <img className='man-pic' src={introPic} alt='man'/>
            </div>
            <div className='intro__bg-pic'>
              <img className='bg-pic' src={introBg} alt='background'/>
            </div>
          </div>
        </section>

        <section className='before200' style={{backgroundColor: '#12b9e3'}}>
          <Content pic={before200} sum='200'/>
        </section>

        <section className='before1000' style={{backgroundColor: '#ee7ea3'}}>
          <Content pic={before1000} sum='1000'/>
        </section>

      </main>
    )
  }
}

class Content extends React.Component {
  render() {
    return (
      <div className='content__wrap'>

        <div className='content__pic'>
          <img src={this.props.pic} alt='people'/>
        </div>

        <div className='content__order'>
          <h3 className='content__title'>
            Посылка до <b>{this.props.sum}</b> 
            <span> &euro;</span>
          </h3>
          <a className='content__link' href='/'>Начать оформление</a>
        </div>

      </div>
    )
  }
}

class Footer extends React.Component {
  render () {
    return (
      <footer className='footer'>
        <div className='footer__wrap'>
          <div className='phone'>
            <img className='phone__pic' src={phone} alt='phone' />
            <span className='phone__number'>+7 902 795 35 33</span>
          </div>
          <div className='mail'>
            <img className='mail__pic' src={mail} alt='mail' />
            <span className='mail__adress'>posilkoved@yandex.ru</span>
          </div>
        </div>
      </footer>
    )
  }
}
